import React, { Component } from 'react';
import Chip from '@material-ui/core/Chip';

const Style = {
    bootstrap: {
        backgroundColor: 'purple',
        color: 'white',
        label: 'Bootstrap'
    },
    html :{
        backgroundColor: 'orange',
        color: 'white'
    }
}

export default class Chips extends Component {
    render() {
        return (
            <Chip size="small" />
        );
    }
}
